(1, 3, 1, 'Armor All Car Cleaning and Leather Wipes - Interior Cleaner for Cars & Truck & Motorcycle, 30 Count (Pack of 2), 18781', 'armor-all-car-cleaning-and-leather-wipes-interior-cleaner-for-cars-truck-motorcycle-30-count-pack-of-2-18781', 'Maintain the beauty of your car’s interior surfaces with Armor All quality auto\n\nproducts. Original Protectant Wipes fight fading, aging and cracking. Leather\n\nCare Wipes renew and revive the rich look of leather, and restore its supple\n\nfeel. Convenient two-pack canisters feature a Moisture Lock Lid that keeps\n\nwipes fresh and can be stored for use whenever you need them.', 'product-images/75445285.jpg', 500.00, 450.00, 17, 7, 1, 1, 4, '2021-12-06 09:01:50', '2021-12-28 11:54:30'),
(2, 5, 1, 'Chemical Guys CWS20316 Foaming Citrus Fabric Clean Carpet & Upholstery Cleaner (Car Carpets, Seats & Floor Mats), 16 oz.', 'chemical-guys-cws20316-foaming-citrus-fabric-clean-carpet-upholstery-cleaner-car-carpets-seats-floor-mats-16-oz', 'Chemical Guys Foaming Citrus Fabric Clean dissolves and removes dirt, odors, and stains from automotive carpets, fabrics, and upholstery. Passengers routinely track in dirt, grime, and filth on the bottoms of their shoes, then grind it deep into floor mats and carpets. Spilled beverages, dropped food, sweat, and body oils can easily stain fabrics and upholstery on seats and door panels. Chemical Guys Fabric Clean is the choice for soccer moms, enthusiasts, and professional detailers everywhere. The hyper-concentrated interior shampoo easily breaks down contaminants, filth, and stains from any fabric surface inside a vehicle. Dilute Fabric Clean in a sprayer bottle, mist a light coat over offending stains, then scrub them with a stiff brush to loosen the bond with the fabric. Easily remove drink spills, dirt stains, and body oils from seats and arm rests with Fabric Clean. The high-sudsing action lifts and separates embedded dirt and filth particles from deep within fabrics and float them to the surface for easier removal. Specialty surfactants and disinfectants release filth, stains, and odors from fabrics for fast and thorough cleaning. Scrub stubborn stains with a stiff bristle brush for maximum cleaning power. Fabric Clean comes blended with Chemical Guys odor elimination technology. Unlike scented perfumes, Fabric Clean helps destroy odor-causing microbes, removing odors at their source.', 'product-images/19536200.jpg', 800.00, NULL, 10, 6, 1, 1, 4, '2021-12-06 10:09:05', '2021-12-29 01:54:47'),
(3, 7, 3, 'New Diamond Leather Steering Wheel Cover with Bling Bling Crystal Rhinestones, Universal Fit 15 Inch Car Wheel Protector for Women Girls,Black', 'new-diamond-leather-steering-wheel-cover-with-bling-bling-crystal-rhinestones-universal-fit-15-inch-car-wheel-protector-for-women-girlsblack', '▶Crystal Steering Wheel Cover Material: High Quality PU Leather and Top diamond craftwork: more stable compare with other same products,and will not hurt your hands.\r\n▶★★★This Bling Steering Wheel Cover for Women Girls is Universal Fit for Steering Wheel with 37-38 cm/14.5-15 inch in Diameter.Suitable for: Audi,Buick(except GL8 old Regal),Cheetah,Chevrolet,Citroen(except ZX),Fiat,Ford,Hyundai(except ix35),Honda,Jeep,Kia,Land Rover,Lexus,Mercedes Benz,Mazda,Peugeot,Renault,Skoda,Sonata,Volkswagen(except Jetta),Volvo,etc.\r\n▶Fashion Charming Design of the Diamond Steering Wheel Cover, Bling under the light: sparkling through windshield and shining your car. Perfect Gift for Women and girls.\r\n▶Great Touch Feeling: the crystal rhinestones will massage your palm and relieve driving fatigue, bring you a great touch and feel.\r\n▶Easy Installation: This PU leather steering wheel cover requires hassle-free installation. Simply slip it right on to your steering wheel and your good to go. Just place the cover on top of the steering wheel. Press and hold the upper part of the cover and gradually lower it with both hands on either side to tighten.', 'product-images/75323848.jpg', 2000.00, 1800.00, 10, 6, 1, 1, 4, '2021-12-28 12:41:44', '2021-12-29 03:39:52'),
(4, 2, 2, 'LivTee Blind Spot Mirror, 2\" Round HD Glass Frameless Convex Rear View Mirrors Exterior Accessories with Wide Angle Adjustable Stick for Car SUV and Trucks, Pack of 2', 'livtee-blind-spot-mirror-2-round-hd-glass-frameless-convex-rear-view-mirrors-exterior-accessories-with-wide-angle-adjustable-stick-for-car-suv-and-trucks-pack-of-2', '【360 Degree】2 pieces packaged, newest upgrade 360 degree rotate and sway adjustable, maximize your view with wide angle in car. All convex spot mirrors are equipped with tiny adjustable swivel mounting bracket for easy installation.\r\n【More Safety】Convex mirrors increase safety by eliminating blind spots for safer driving when passing and changing lanes on any road. Perfect for any Car, Van, SUV and Trucks.\r\n【HD Glass】Our 2\" HD Glass Curved Blindspot Mirrors is frameless and has a slim design, IP65 waterproof, rust resistant, Convex ultra thin HD glass, no haze rear view side mirror.\r\n【Easy to install】Please clean your original car side mirrors, then stick blind spot mirrors to the mounting bracket and install them on side rear view mirrors.\r\n【Service Guarantee】Any issues or questions please feel free to contact us, we are always here to satisfy all of you.', 'product-images/24272289.jpg', 5000.00, NULL, 11, 4, 1, 1, 4, '2021-12-28 12:45:15', '2021-12-29 01:54:47'),
(5, 3, 4, 'Cup Holder Phone Holder, [No Shaking & Height-Adjustable Pole] Car Cup Holder Phone Mount, Cell Phone Cradle for iPhone, Samsung and More Smart Phone(Grey)', 'cup-holder-phone-holder-no-shaking-height-adjustable-pole-car-cup-holder-phone-mount-cell-phone-cradle-for-iphone-samsung-and-more-smart-phonegrey', '[More Longer Extendable Pole] Total 15-inch height, More stable and height-adjustable pole. A jointed pole for all round movement further enhances your vision and operability. 360° rotatable for desired position vertical or horizontal mode on our cup holder cell phone holder. It can ensure safe driving whether you are talking, navigating, listening to music or charging.\r\n[Double layer expandable base] Suitable for 2.1”-4.7” diameter cup holder. Double layer expandable “wing” to fit the various cup holders in the car, truck, RV, boat, golf cart, etc without any attachment. Keep the advantage, the modern design knob still in the base.\r\n[Upgrade More Adaptable Phone Holder]: More DEEPER phone holder (up to 0.9\") with WIDER space (up to 4\"). Featuring one-button release curved arm and extendable feet, they all with soft silicone pad. Let your phone without scratch first. Secondly, hold your phone securely without shaking or wobbling\r\n[Drive Now Text Later] Safety first! Keep your hands on the steering wheel and your eyes on the road while conveniently using your phone\'s GPS navigation and hands-free features. You will worth try it if you have a car. It is the most reassuring choice to give this as a gift to someone you care about.\r\n[Broad Compatibility]: Suitable for all types of 2.2” - 4” wide devices, such as iPhone 13 Pro Max/12 Mini 11 Pro/XS Mas/SE 2/XR/8/7 Plus/6s, Samsung S21 Ultra/S20+/S9 Plus/S7 Edge/Note20, Huawei, HTC, LG, MOTO, GPS, Google Pixel, Nexus, Nikia, Sony, Huawei, Asus, Honor, Lenovo, Motorola, Oppo, Palm, Realme, Vivo, Xiaomi, etc. Note: You might not need to remove phone case, socket mount or something attached your phone when using this product. It will max support a totally 0.8\" thick device.', 'product-images/87741369.jpg', 1800.00, 1650.00, 16, 8, 1, 1, 4, '2021-12-28 12:48:58', '2022-03-01 07:49:58'),
(6, 4, 5, 'Fahren H11/H9/H8 LED Headlight Bulbs, 60W 10000 Lumens Super Bright LED Headlights Conversion Kit 6500K Cool White IP68 Waterproof, Pack of 2', 'fahren-h11h9h8-led-headlight-bulbs-60w-10000-lumens-super-bright-led-headlights-conversion-kit-6500k-cool-white-ip68-waterproof-pack-of-2', '300% Brighter Than Halogen Top Automotive Grade LED chips with 60W, 10,000LM per pair, 6500K cool white. Super focused beam pattern design provides wider and farther lighting range which is 3 times brighter than your original halogen bulb.\r\nOver 5,0000 Hours Lifespan Whole aviation aluminum body, unique hollow carved heat sink design and 1,2000RPM turbo cool fan provide super cooling ability, which ensures a longer lifespan up to 5,0000 hours.\r\n10 Minutes Easy Installation Almost 1:1 mini design same as halogen, perfectly fit into your housing and factory sockets without any modification, just plug and play.\r\nCAN bus Ready for 98% Vehicles Our bulbs work with 98% of vehicle\'s computer system without error, while some sensitive models of Ford, Jeep, Dodge, Ram, Volvo, Lexus, Chrysler, Mini and etc may require additional CAN bus decoder to be installed.\r\nNote The filter system may not be 100% accurate or up to date, please check your owner\'s manual or the part number on your original bulbs to confirm the bulb size. Refer to \"how to pick the right bulb size\" in our Product Description.', 'product-images/86029296.jpg', 4500.00, 4200.00, 5, 8, 1, 1, 4, '2021-12-28 13:01:28', '2022-01-03 04:44:49'),
(7, 6, 5, 'iBrightstar Newest 9-30V Super Bright Low Power 1157 2057 2357 7528 BAY15D LED Bulbs with Projector Replacement for Turn Signal Lights and Brake Lights, Amber Yellow', 'ibrightstar-newest-9-30v-super-bright-low-power-1157-2057-2357-7528-bay15d-led-bulbs-with-projector-replacement-for-turn-signal-lights-and-brake-lights-amber-yellow', '(Set of 2 Bulbs) 54SMD 3014 & 3SMD 3030 high Brightness chips per bulb,Working Voltage: 9v-30v\r\nFits: 1157 BAY15D 1157 1157NA 1157A 1178A 1196 2057 2057A 2357 2357A 2357NA 2397 7528 etc. Easy installation, plug and play.\r\nApplication: Turn Signal Lights, Brake Lights, Tail Lights, Side Marker Lights, Corner Lights, Blinker Lights etc. Load resistor or flash relay might be needed to prevent the hyper flash when replacement for Turn Signal Lights.\r\nAdvantage: Exclusive design, 300% brighter than original halogen bulb, full Aluminum Housing with Projection lens for Maximum Light output and better heat distribution, built in Constant Current IC for Longer life span & Low Power Consumption.\r\nPlease double check owners manual or original bulb number to confirm before placing an order. Any other problem please feel free to contact us, we are always here to satisfy of you.', 'product-images/87626612.jpg', 3000.00, 2800.00, 0, 9, 1, 1, 4, '2021-12-28 13:06:38', '2022-03-01 07:49:58'),
(8, 4, 3, 'Silence Shopping 3D Carbon Fiber Vinyl Car DIY Wrap Sheet Roll Film Sticker Decal - Red Color 127X30cm 50\"X11.8\" (Red)', 'silence-shopping-3d-carbon-fiber-vinyl-car-diy-wrap-sheet-roll-film-sticker-decal-red-color-127x30cm-50x118-red', 'Red Carbon Fiber Wrap Vinyl Roll 100% Brand (Silence Shopping Store) new with good quality;\r\nCarbon Fiber Style Sheet\'s Color: Red, Size:127X30cm( 50\"X11.8\")\r\nSelf adhesive stickers, High temperature & water Proof;This vinyl can be installed using 3M 94 Primer and 3M Edge sealer, these are not mandatory, these products will promote adhesion and add life to your vinyl. The sealer or primer will not remove the glue, deform the vinyl or ruin the texture unlike cheaper quality films.\r\nThe carbon sticker can be applied to car used, motorcycle parts, metal, mobile phone, laptop, furniture window molding\r\nSelf-adhesive, easy apply. Stretchable with heat. Water resistant. Easily cleansed with water. Long lasting; great for Christmas, Thanksgiving Day, Birthday, or Fathers Day gifts, good present for families, friends', 'product-images/93383069.jpg', 1500.00, NULL, 9, 2, 1, 1, 4, '2021-12-28 13:11:34', '2022-03-01 07:49:58'),
(9, 6, 2, 'OxGord Windshield Snow Cover - Original Design - Best for Ice, Frost & Snow Removal - All Weather Winter & Summer Front Window Automotive Covers Sun & Snow-Shade - Fits Truck SUV Van Car Accessories', 'oxgord-windshield-snow-cover-original-design-best-for-ice-frost-snow-removal-all-weather-winter-summer-front-window-automotive-covers-sun-snow-shade-fits-truck-suv-van-car-accessories', 'Quit the Scraping Misery: OxGord\'s windshield snow cover is best for blocking your windshield from the snow, ice, frost, blizzard, rain, sleet, slush, water, hail, and even protects from snowstorms.\r\nHeavy Duty & Snug Fit: OxGord snow cover is made of a toughest 600D Oxford material blended with the softest PVC inner layer which provides superior windshield protection from the snow. Its 100% waterproof so it won\'t frost up even after storms.\r\nOriginal Design for All Weather: Regardless winter or summer, OxGord snow cover for auto windshield protects against the snow, sun, uv rays, heat, rain, fall leaves, dirt, dust and certainly during the ice cold winter debris & weather\r\nDesigned for Quick installation: No tools required - Requires both front doors & side view mirrors - Cover side flaps close inside car doors to help prevent theft & from being blown away. Scratch-Proof this item DOES NOT USE magnets or suction cups\r\nUniversal Fit: Dimensions 75”L x 42.25”H inches fits most cars, trucks, vans, and SUV’s - All-season snowcover protector provides full anti freeze wind-shield guard coverage for your front window end to end thermal blocker.', 'product-images/41297714.jpg', 2000.00, NULL, 15, 7, 0, 1, 4, '2021-12-28 13:15:21', '2021-12-29 02:47:56'),
